import { useEffect, useState } from "react";
import { getAllEmp } from "../Service/service";
import Emp from "./emp";

export default function DisplayEmp() {
    const [emps, setemps] = useState(null);
    useEffect(() => {
        return () => {
            getAllEmp().then(data => {
                setemps(data);
            });
        };
    });

    return (
        <>
        {emps.forEach(emp => {
            <Emp empName={emp.name} empDesc={emp.role}></Emp>
        })}
        </>
    );
}
